        <DataContextProvider>
            <Component {...pageProps} />;
        </DataContextProvider>
    );
};

MyApp.getInitialProps = async ({ Component, ctx }) => {
    const pageProps = Component.getInitialProps ? await Component.getInitialProps(ctx) : {};

